package org.example.Data;import javax.persistence.*;import java.io.Serializable;@Embeddablepublic class ClientKey implements Serializable {    @Column(name = "client_id")    private Long id;    @Column(name = "bank")    private String bank;    public ClientKey() {};    public ClientKey(long id, String bank) {        this.id = id;        this.bank = bank;    }    public Long getId() {        return id;    }    public String getBank() {        return bank;    }}